import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'react-bulma-components/dist/react-bulma-components.min.css';
import { Section, Columns, Card, Heading, Media, Image, List, Footer, Menu} from 'react-bulma-components';
import BackgroundVideo from './BackgroundVideo.js';
import NavbarComponent from './Navbar.js'
import Mission from './Mission.js'
import Product from './Product.js'
import Team from './Team.js'

function App() {
  return (
    <div className="App">
      <NavbarComponent/>
      <BackgroundVideo/>
      <Mission/>
      <Product/>
      <Team/>
      <Footer><Heading>Contact Us:</Heading> <br></br>Email: company@gmail.com <br></br>Phone: 0730000000 </Footer>
    </div>
  );
}

export default App;
